function launch() external {
    // Only the owner can initiate the launch
    require(msg.sender == owner, "Ownable: caller is not the owner");

    // Bit-flag that represents the launched state
    uint256 LAUNCH_FLAG = 0x010000000000000000000000000000000000000000;

    // Ensure the contract has not been launched already
    require(bytes1(launched / LAUNCH_FLAG) == 0x00, "Already launched");

    // Mark the contract as launched
    launched |= uint248(LAUNCH_FLAG);

    // Notify listeners
    emit Launched(block.number);
}

